import React from "react";

const Login = () => {
    <nav className="login">
        <h2>Inventory</h2>
        <p>Sign in to manage your store's inventory.</p>
        <button className="github" onclick={() => this.props.authenticate('Github')}>Log In With Github</button>
        <button className="twitter" onclick={() => this.props.authenticate('Twitter')}>Log In With Github</button>
        <button className="facebook" onclick={() => this.props.authenticate('Facebook')}>Log In With Github</button>

    </nav>

};


export default Login;
